// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@chainlink/contracts/src/v0.8/VRFConsumerBase.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/cryptography/MerkleProof.sol";
import {IWETH} from "./interfaces/IWETH.sol";

contract Raffle is Ownable, Pausable, ReentrancyGuard, VRFConsumerBase {
    using SafeERC20 for IERC20;

    enum RaffleState {
        IN_PROGRESS,
        FINISHED,
        COMPLETED,
        REFUNDED,
        CLAIMED
    }

    enum RaffleType {
        ERC721,
        ERC20
    }

    struct RaffleData {
        address assetContract;
        address raffleOwner;
        address raffleWinner;
        RaffleState raffleState;
        RaffleType raffleType;
        uint256 nftIdOrAmount;
        address currency;
        uint256 pricePerTicket;
        bytes32 MerkleRoot;
        uint128 endTimestamp;
        uint128 numberOfTickets;
        uint128 ticketsSold;
        uint128 minimumTicketsSold;
    }

    // ERC20 address => isWhitelisted?
    mapping(address => bool) public whitelistedCurrencies;
    // raffleID => RaffleData
    mapping(uint256 => RaffleData) public raffles;
    // raffleID => ticketId => ticketOwner
    mapping(uint256 => mapping(uint256 => address)) public raffleTickets;
    // ChainlinkRequest => raffleID
    mapping(bytes32 => uint256) private chainlinkRequestToRaffleID;

    // Number of raffles created so far
    uint256 public raffleCounter;

    // Chainlink related state variables
    bytes32 public immutable linkKeyHash;
    uint256 public immutable linkFee;

    IWETH constant WETH = IWETH(0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2);
    uint256 constant REFUND_COLLATERAL_FEE = 0.1 ether;

    // 2% Fee
    uint256 public FEE_NUMERATOR = 200;
    uint256 public FEE_DENOMINATOR = 10000;
    /**
        Token address => Amount that owners of the contract can claim as fee rewards
        address(0) = Ether
     */
    mapping(address => uint256) public totalAmountClaimable;

    event NewERC721RaffleCreated(uint256 raffleId, address nftCollection, uint256 nftId);
    event NewERC20RaffleCreated(uint256 raffleId, address tokenAddress, uint256 amount);
    event ERC721RaffleCancelled(uint256 raffleId, address raffleOwner, address nftContract, uint256 nftId);
    event ERC20RaffleCancelled(uint256 raffleId, address raffleOwner, address assetContract, uint256 amount);
    event ERC20CurrencyAdded(address currency);
    event ERC20CurrencyRemoved(address currency);
    event RaffleStateChanged(uint256 raffleId, RaffleState oldRaffleState, RaffleState newRaffleState);
    event ChainlinkRequest(bytes32 requestId);

    constructor(bytes32 _linkKeyHash, uint256 _linkFee, address _vrfCoordinator, address _vrfLinkTokenAddress) VRFConsumerBase(_vrfCoordinator, _vrfLinkTokenAddress) {
        linkKeyHash = _linkKeyHash;
        linkFee = _linkFee;
        // Ether is always whitelisted, Ether/Native asset = address(0)
        whitelistedCurrencies[address(0)] = true;
    }

    /**
     * @notice  Allows users to create a raffle of an ERC721 asset
     * @param   _nftCollection Address of the NFT to raffle
     * @param   _nftId NFTid of the _nftCollection
     * @param   _currency Tickets will be bought with this ERC20 token. address(0) should be put here if the currency will be Ether
     * @param   _pricePerTicket Price per ticket. It can be zero in case of an "airdrop"
     * @param   _numberOfTickets Number of tickets that will be sold as maximum in the raffle
     * @param   _minimumTicketsSold Number of tickets that should be sold in order to be a success raffle. If this minimum amount is not
        reached the owner of the raffle will be able to cancel the raffle, returning the users their payment plus a little collateral to cover
        for the gas fees. If this amount is reached, normal flow will be followed.
     * @param   _durationInSeconds Duration in seconds of the raffle
     * @param   _merkleRoot Used so only whitelisted users can buy raffle tickets
     */
    function createERC721Raffle(address _nftCollection, uint256 _nftId, address _currency, uint256 _pricePerTicket, uint128 _numberOfTickets, uint128 _minimumTicketsSold, uint128 _durationInSeconds, bytes32 _merkleRoot) external payable whenNotPaused {
        require(msg.sender == IERC721(_nftCollection).ownerOf(_nftId), "You do not own this NFT");
        require(whitelistedCurrencies[_currency], "This currency is not whitelisted");
        require(_numberOfTickets > 1, "Raffles must have at least 2 tickets");
        require(_durationInSeconds >= 3600, "Minimum duration is 1 hour");

        // _minimumTicketsSold * REFUND_COLLATERAL_FEE => Ether that will be paid to users in case the Raffle is cancelled
        require(msg.value == (_minimumTicketsSold * REFUND_COLLATERAL_FEE), "Incorrect collateral sent");

        // Transfering the NFT into our contract
        IERC721(_nftCollection).transferFrom(msg.sender, address(this), _nftId);

        RaffleData storage raffleData = raffles[raffleCounter++];
        raffleData.assetContract = _nftCollection;
        raffleData.raffleOwner = msg.sender;
        raffleData.raffleState = RaffleState.IN_PROGRESS;
        raffleData.raffleType = RaffleType.ERC721;
        raffleData.nftIdOrAmount = _nftId;
        raffleData.currency = _currency;
        raffleData.pricePerTicket = _pricePerTicket;
        raffleData.MerkleRoot = _merkleRoot;
        raffleData.endTimestamp = uint128(block.timestamp) + _durationInSeconds;
        raffleData.numberOfTickets = _numberOfTickets;
        raffleData.minimumTicketsSold = _minimumTicketsSold;

        emit NewERC721RaffleCreated(raffleCounter, _nftCollection, _nftId);
    }

    /**
        * @notice  Allows users to create a raffle of an ERC20 asset
        * @param   _tokenAddress Address of the token amount to raffle
        * @param   _amount Quantity of tokens to be raffled
        * @param   _currency Tickets will be bought with this ERC20 token. address(0) should be put here if the currency will be Ether
        * @param   _pricePerTicket Price per ticket. It can be zero in case of an "airdrop"
        * @param   _numberOfTickets Number of tickets that will be sold as maximum in the raffle
        * @param   _minimumTicketsSold Number of tickets that should be sold in order to be a success raffle. If this minimum amount is not
        reached the owner of the raffle will be able to cancel the raffle, returning the users their payment plus a little collateral to cover
        for the gas fees. If this amount is reached, normal flow will be followed
        * @param   _durationInSeconds Duration in seconds of the raffle
        * @param   _merkleRoot Used so only whitelisted users can buy raffle tickets
    */
    function createERC20Raffle(address _tokenAddress, uint256 _amount, address _currency, uint256 _pricePerTicket, uint128 _numberOfTickets, uint128 _minimumTicketsSold, uint128 _durationInSeconds, bytes32 _merkleRoot) external payable whenNotPaused {
        require(whitelistedCurrencies[_tokenAddress], "You cannot raffle this type of tokens yet");
        require(whitelistedCurrencies[_currency], "This currency is not whitelisted");
        require(_numberOfTickets > 1, "Raffles must have at least 2 tickets");
        require(_durationInSeconds >= 3600, "Minimum duration is one hour");

        if (_tokenAddress == address(0)) {
            require(msg.value == _amount + (_minimumTicketsSold * REFUND_COLLATERAL_FEE), "The Ether sent is not correct");
        } else {
            // _minimumTicketsSold * REFUND_COLLATERAL_FEE => Ether that will be paid to users in case the Raffle is cancelled
            require(msg.value == (_minimumTicketsSold * REFUND_COLLATERAL_FEE), "Incorrect collateral sent");
            // Transfer tokens to the contract
            IERC20(_tokenAddress).safeTransferFrom(msg.sender, address(this), _amount);
        }

        RaffleData storage raffleData = raffles[raffleCounter++];
        raffleData.assetContract = _tokenAddress;
        raffleData.raffleOwner = msg.sender;
        raffleData.raffleState = RaffleState.IN_PROGRESS;
        raffleData.raffleType = RaffleType.ERC20;
        raffleData.nftIdOrAmount = _amount;
        raffleData.currency = _currency;
        raffleData.pricePerTicket = _pricePerTicket;
        raffleData.MerkleRoot = _merkleRoot;
        raffleData.endTimestamp = uint128(block.timestamp) + _durationInSeconds;
        raffleData.numberOfTickets = _numberOfTickets; 
        raffleData.minimumTicketsSold = _minimumTicketsSold;

        emit NewERC20RaffleCreated(raffleCounter, _tokenAddress, _amount);
    }

    /**
        * @notice  Allows users to cancel a raffle if NO tickets were sold yet
        * @param   _raffleId The ID of the raffle
    */
    function cancelRaffle(uint256 _raffleId) external nonReentrant whenNotPaused{
        require(_raffleId <= raffleCounter, "Raffle does not exist");
        RaffleData memory raffleData = raffles[_raffleId];
        require(msg.sender == raffleData.raffleOwner, "You cannot cancel someone else's raffle");
        require(raffleData.raffleState == RaffleState.IN_PROGRESS, "This raffle has already ended");
        require(raffleData.ticketsSold < 1, "Tickets have already been bought");

        // Delete the object from storage
        delete raffles[_raffleId];
        // Set is as CLAIMED
        raffles[_raffleId].raffleState = RaffleState.REFUNDED;
        emit RaffleStateChanged(_raffleId, RaffleState.IN_PROGRESS, RaffleState.REFUNDED);

        // Check which type of asset 
        if (raffleData.raffleType == RaffleType.ERC721) {
            IERC721(raffleData.assetContract).transferFrom(address(this), raffleData.raffleOwner, raffleData.nftIdOrAmount);
            emit ERC721RaffleCancelled(_raffleId, raffleData.raffleOwner, raffleData.assetContract, raffleData.nftIdOrAmount);
        } 
        if (raffleData.raffleType == RaffleType.ERC20) {
            uint256 amountToRefund = raffleData.nftIdOrAmount;
            if (raffleData.assetContract == address(0)) { // This means we are dealing with a raffle of native Ether
                _handleEtherTransfer(msg.sender, amountToRefund);
            } 
            else {
                IERC20(raffleData.assetContract).safeTransferFrom(address(this), raffleData.raffleOwner, amountToRefund);
            }
            emit ERC20RaffleCancelled(_raffleId, raffleData.raffleOwner, raffleData.assetContract, amountToRefund);
        }

        /**
            Giving the Raffle owner back only the 90% of the initial REFUND_COLLATERAL_FEE
            10% is taken as a fee
        */ 
        uint256 totalCollateral = REFUND_COLLATERAL_FEE * raffleData.minimumTicketsSold;
        uint256 collateralRefunded =  totalCollateral * 9000 / 10000;
        totalAmountClaimable[address(0)] += totalCollateral - collateralRefunded;
        _handleEtherTransfer(msg.sender, collateralRefunded);
    }

    /**
     * @notice  Allows users to buy tickets for a Raffle
     * @param   _raffleId The ID of the raffle the user wants to buy a ticket for
     * @param   _numberOfTickets The number of tickets an user wants to buy 
     */
    function buyRaffleTicket(uint256 _raffleId, uint128 _numberOfTickets) external payable whenNotPaused {
        RaffleData memory raffleData = raffles[_raffleId];
        require(raffleData.raffleOwner != address(0), "This raffle does not exist");
        require(raffleData.MerkleRoot == bytes32(0), "Whitelisted raffle. Use buyWhitelistedRaffleTicket() instead");
        require(block.timestamp < raffleData.endTimestamp, "This raffle has already ended");
        require(raffleData.raffleState == RaffleState.IN_PROGRESS, "This raffle has already ended");
        require(raffleData.ticketsSold < raffleData.numberOfTickets, "Tickets sold out");
        require(_numberOfTickets <= (raffleData.numberOfTickets - raffleData.ticketsSold), "There are not so many tickets available to buy");
        // Handle the payment
        if (raffleData.currency == address(0)){
            require (msg.value >= (_numberOfTickets * raffleData.pricePerTicket), "Not enough Ether sent as payment");
        }
        else {
            IERC20(raffleData.currency).safeTransferFrom(msg.sender, address(this), _numberOfTickets * raffleData.pricePerTicket);
        }
        // Assign the tickets to the buyer
        for (uint256 i; i < _numberOfTickets; ++i){
            raffleTickets[_raffleId][raffleData.ticketsSold + i] = msg.sender;
        }
        raffles[_raffleId].ticketsSold += _numberOfTickets;  
    }

    /**
     * @notice  Allows users to buy tickets for a whitelisted Raffle
     * @param   _raffleId The ID of the raffle the user wants to buy a ticket for
     * @param   _numberOfTickets The number of tickets an user wants to buy 
     * @param   _merkleProof MerkleProof used to verify user is aprt of the whitelist 
     */
    function buyWhitelistedRaffleTicket(uint256 _raffleId, uint128 _numberOfTickets, bytes32[] calldata _merkleProof) external payable whenNotPaused {
        RaffleData memory raffleData = raffles[_raffleId];
        require(raffleData.raffleOwner != address(0), "This raffle does not exist");
        require(raffleData.MerkleRoot != bytes32(0), "Non-whitelisted raffle. Use buyRaffleTicket() instead");
        require(block.timestamp < raffleData.endTimestamp, "This raffle has already ended");
        require(raffleData.raffleState == RaffleState.IN_PROGRESS, "This raffle has already ended");
        require(raffleData.ticketsSold < raffleData.numberOfTickets, "Tickets sold out");
        require(_numberOfTickets <= (raffleData.numberOfTickets - raffleData.ticketsSold), "There are not so many tickets available to buy");
        bytes32 leaf = keccak256(abi.encodePacked(msg.sender));
        require(MerkleProof.verify(_merkleProof, raffleData.MerkleRoot, leaf), "User not whitelisted");
        // Handle the payment
        if (raffleData.currency == address(0)){
            require (msg.value >= (_numberOfTickets * raffleData.pricePerTicket), "Not enough Ether sent as payment");
        }
        else {
            IERC20(raffleData.currency).safeTransferFrom(msg.sender, address(this), _numberOfTickets * raffleData.pricePerTicket);
        }
        // Assign the tickets to the buyer
        for (uint256 i; i < _numberOfTickets; ++i){
            raffleTickets[_raffleId][raffleData.ticketsSold + i] = msg.sender;
        }
        raffles[_raffleId].ticketsSold += _numberOfTickets; 
    }

    /**
     * @notice  Allows users to complete a Raffle. The winner of the raffle will receive the asset.
                The owner of the raffle will receive his payment
                Cron job will call daily all the pending raffles. Users can also call it
     * @param   _raffleId The ID of the raffle the user wants to buy a ticket for
     */
    function completeRaffle(uint256 _raffleId) external whenNotPaused {
        RaffleData memory raffleData = raffles[_raffleId];
        require(raffleData.raffleOwner != address(0), "This raffle does not exist");
        require(raffleData.raffleState == RaffleState.IN_PROGRESS, "This raffle was already completed");
        if (raffleData.ticketsSold != raffleData.numberOfTickets){
            require(block.timestamp >= raffleData.endTimestamp, "Raffle is not completed");
        }
        // In this case we must refund all the ticket buyers
        if (raffleData.ticketsSold < raffleData.minimumTicketsSold){
            // Send the asset back to the raffleOwner, no fees
            if (raffleData.raffleType == RaffleType.ERC721){
                IERC721(raffleData.assetContract).transferFrom(address(this), raffleData.raffleOwner, raffleData.nftIdOrAmount);
            }
            if (raffleData.raffleType == RaffleType.ERC20){
                IERC20(raffleData.assetContract).safeTransferFrom(address(this), raffleData.raffleOwner, raffleData.nftIdOrAmount);
            }
            // Taking as a fee REFUND_COLLATERAL_FEE * number_of_tickets_left
            totalAmountClaimable[address(0)] = (raffleData.minimumTicketsSold - raffleData.ticketsSold) * REFUND_COLLATERAL_FEE;
            raffles[_raffleId].raffleState = RaffleState.REFUNDED;
            emit RaffleStateChanged(_raffleId, RaffleState.IN_PROGRESS, RaffleState.REFUNDED);

        }
        // Normal flow
        else {
            // This will mark the raffle State as FINISHED. Can only be called once.
            bytes32 request = _requestRandomness(_raffleId);
            emit ChainlinkRequest(request);
            chainlinkRequestToRaffleID[request] = _raffleId;
        }
    }

    /**
     * @notice  Allows users to claim the raffle. Owner of the raffle will receive the payment and the winner his asset
     * @param   _raffleId The ID of the raffle the user wants to buy a ticket for
     */
    function claimRaffle(uint256 _raffleId) external nonReentrant whenNotPaused {
        RaffleData storage raffleData = raffles[_raffleId];
        require(raffleData.raffleOwner != address(0), "This raffle does not exist");
        require(raffleData.raffleState == RaffleState.COMPLETED, "This raffle was already completed");

        raffleData.raffleState = RaffleState.CLAIMED;
        emit RaffleStateChanged(_raffleId, RaffleState.COMPLETED, RaffleState.CLAIMED);

        address raffleOwner = raffleData.raffleOwner;
        address winner = raffleData.raffleWinner;

        // Sending the asset to the winner
        if (raffleData.raffleType == RaffleType.ERC721){
            IERC721(raffleData.assetContract).transferFrom(address(this), winner, raffleData.nftIdOrAmount);
        }
        if (raffleData.raffleType == RaffleType.ERC20){
            // Ether won in the Raffle 
            if (raffleData.assetContract==address(0)){
                _handleEtherTransfer(winner, raffleData.nftIdOrAmount);
            }
            else{
                IERC20(raffleData.assetContract).safeTransferFrom(address(this), winner, raffleData.nftIdOrAmount);
            }
        }

        uint256 totalAmountEarned = raffleData.ticketsSold * raffleData.pricePerTicket;
        uint256 fee = (totalAmountEarned * FEE_NUMERATOR) / FEE_DENOMINATOR;
        totalAmountEarned -= fee;
        address raffleCurrency = raffleData.currency;
        totalAmountClaimable[raffleCurrency] += fee;

        // Payments to the raffle owner
        if(raffleCurrency == address(0)){
            // Payment in Ether
            _handleEtherTransfer(raffleOwner, totalAmountEarned);
        }
        else{
            // Payment with ERC20
            IERC20(raffleCurrency).safeTransfer(raffleOwner, totalAmountEarned);
        }
        // Giving back REFUND_COLLATERAL_FEE
        _handleEtherTransfer(raffleOwner, REFUND_COLLATERAL_FEE * raffleData.minimumTicketsSold);
    }

    /**
     * @notice  Allows users to claim a cancelled raffle where they will receive their initially payment plus 0.1 Ether
     * @param   _raffleId The ID of the raffle the user wants to buy a ticket for
     * @param   ticketIds Array of ticketIds to claim
     */
    function claimCancelledRaffle(uint256 _raffleId, uint256[] calldata ticketIds) external nonReentrant whenNotPaused{
        RaffleData memory raffleData = raffles[_raffleId];
        require(raffleData.raffleState == RaffleState.REFUNDED, "Raffle is not in REFUNDED state");
        uint256 len = ticketIds.length;
        for(uint i; i < len; ++i){
            require(raffleTickets[_raffleId][ticketIds[i]] == msg.sender, "You do not own this ticket Id");
            raffleTickets[_raffleId][ticketIds[i]] = address(0);
        }
        uint256 totalRefund = (len * raffleData.pricePerTicket) + (len * REFUND_COLLATERAL_FEE);
        if (raffleData.currency == address(0)){
            _handleEtherTransfer(msg.sender, totalRefund);
        }
        else{
            IERC20(raffleData.currency).safeTransfer(msg.sender, totalRefund);
        }
    }

    /** ############################################################################################
     *              INTERNAL/PRIVATE FUNCTIONS
     *  ############################################################################################
     */

    function _requestRandomness(uint256 _raffleId) internal returns (bytes32 requestId) {
        require(LINK.balanceOf(address(this)) >= linkFee, "Not enough LINK");
        RaffleData storage raffleData = raffles[_raffleId];
        raffleData.raffleState = RaffleState.FINISHED;
        emit RaffleStateChanged(_raffleId, RaffleState.IN_PROGRESS, RaffleState.FINISHED);
        requestId = requestRandomness(linkKeyHash, linkFee);
    }

    function fulfillRandomness(bytes32 requestId, uint256 randomness) internal override {
        uint256 raffleId = chainlinkRequestToRaffleID[requestId];
        RaffleData storage raffleData = raffles[raffleId];
        raffleData.raffleState = RaffleState.COMPLETED;
        emit RaffleStateChanged(raffleId, RaffleState.FINISHED, RaffleState.COMPLETED);
        // Picking up the winner
        uint256 winningIndex = randomness % raffleData.ticketsSold;
        raffleData.raffleWinner = raffleTickets[raffleId][winningIndex];
    }

    //TODO: REMOVE AFTER TESTING
    function fulfillRandomnessTest(bytes32 requestId, uint256 randomness) external {
        fulfillRandomness(requestId, randomness);
    }

    /**
     *  Function to handle Ether transfers
     */
    function _handleEtherTransfer(address _dest, uint256 _amount) internal {
        // Handle ETH payment
        require(address(this).balance >= _amount, "_handleEtherTransfer insolvent");
        uint256 gas =  gasleft();
        (bool success, ) = _dest.call{value: _amount, gas: gas}("");
        // If the ETH transfer fails (sigh), wrap the ETH and try send it as WETH.
        if (!success) {
            WETH.deposit{value: _amount}();
            IERC20(address(WETH)).safeTransfer(_dest, _amount);
        }
    }

    /** ############################################################################################
     *              ONLYOWNER FUNCTIONS
     *  ############################################################################################
     */

    /**
     * @notice  Used to pause/unpause the smart contract by the owner
     */
    function togglePause() external onlyOwner {
        if (!paused()) _pause();
        else _unpause();
    }

    /**
     * @notice  Used to whitelist a new ERC20 token to be used as a payment currency
     */
    function whitelistCurrency(address _ERC20TokenAddress) external onlyOwner {
        require(!whitelistedCurrencies[_ERC20TokenAddress], "Token is already whitelisted");
        whitelistedCurrencies[_ERC20TokenAddress] = true;
        emit ERC20CurrencyAdded(_ERC20TokenAddress);
    }

    /**
     * @notice  Used to blacklist a ERC20 token so it can not be used any longer as a payment currency
     */
    function blacklistCurrency(address _ERC20TokenAddress) external onlyOwner {
        require(whitelistedCurrencies[_ERC20TokenAddress], "Token is not whitelisted");
        whitelistedCurrencies[_ERC20TokenAddress] = false;
        emit ERC20CurrencyRemoved(_ERC20TokenAddress);
    }

    /**
     * @notice  Used by the contract owners to claim the fees accrued
     * @param   _tokenAddress List of tokens to withdraw the fees
     * @param   _amounts List of amounts that will be withdrawn
     * @param   _receiver Address that will receive the fees
     */
    function withdrawFees(address[] calldata _tokenAddress, uint256[] calldata _amounts, address _receiver) external onlyOwner {
        uint256 len = _tokenAddress.length;
        require(len == _amounts.length, "Array lengths do not match");
        uint256 amount;
        address tokenAddress;
        for (uint256 i; i < len; ++i) {
            tokenAddress = _tokenAddress[i];
            amount = _amounts[i];
            require(amount <= totalAmountClaimable[tokenAddress], "Amount too high");
            if(tokenAddress == address(0)){
                _handleEtherTransfer(_receiver, amount);
            }
            else{
                IERC20(tokenAddress).safeTransfer(_receiver, amount);
            }
            // No overflow here as => require(amount <= totalAmountClaimable[tokenAddress])
            unchecked {
                totalAmountClaimable[tokenAddress] -= amount;
            }
        }
    }

    /** ############################################################################################
     *                 VIEW FUNCTIONS
     *  ############################################################################################
     */

    // For frontend 
    function getRaffleDetails(uint256 _raffleId) external view returns(RaffleData memory) {
        require(_raffleId <= raffleCounter, "The raffle ID does not exist");
        return(raffles[_raffleId]);
    }

    function getRaffleState(uint256 _raffleId) external view returns(RaffleState) {
        require(_raffleId <= raffleCounter, "The raffle ID does not exist");
        return(raffles[_raffleId].raffleState);
    }

    function getRaffleTicketOwner(uint256 _raffleId, uint256 _ticketId) external view returns(address) {
        address ticketOwner = raffleTickets[_raffleId][_ticketId];
        require(ticketOwner != address(0), "Ticket does not exist");
        return ticketOwner;
    }

    function isCurrencyWhitelisted(address _erc20Token) external view returns(bool) {
        return whitelistedCurrencies[_erc20Token];
    }

    // Get all active raffles for the frontend
    // TODO: Block Gas Limit? This should be remade
    function getActiveRaffles() external view returns(RaffleData[] memory) {
        RaffleData[] memory activeRaffles;
        uint256 counter=0;
        for (uint256 i; i < raffleCounter; ++i) {
            if (raffles[i].raffleState == RaffleState.IN_PROGRESS) {
                activeRaffles[counter] = raffles[i];
                ++counter;
            }
        }
        return activeRaffles;
    }
